1) Download APK+Obb files and copy those files to sdcard or internal storage.
2) Download an app called &quot;ZArchiver&quot; from play store https://play.google.com/store/apps/details?id=ru.zdevs.zarchiver
3) Open ZArchiver and extract any one part of Split Zip files of obb/data to folder /sdcard/android/obb/
4) Then Install given APK
